Remove duplicates by field based on secondary field<p>I have a use case where I am working with objects that appear as such:</p>
<pre class="lang-json prettyprint-override"><code>{
  &quot;data&quot;: {
    &quot;uuid&quot;: 0001-1234-5678-9101
  },
  &quot;organizationId&quot;: 10192432,
  &quot;lastCheckin&quot;: 2022-03-19T08:23:02.435+00:00
}
</code></pre>
<p>Due to some old bugs in our application, we've accumulated many duplicates for these items in the database. The origin of the duplicates has been resolved in an upcoming release, but I need to ensure that prior to the release there are no such duplicates because the release includes a unique constraint on the &quot;data.uuid&quot; property.</p>
<p>I am trying to delete records based on the following criteria:</p>
<pre><code>Any duplicate record based on &quot;data.uuid&quot; WHERE lastCheckin is NOT the most recent OR organizationId is missing.
</code></pre>
<p>Unfortunately, I am rather new to using MongoDB and do not know how to express this in a query. I have tried aggregated to obtain the duplicate records and, while I've been able to do so, I have so far been unable to exclude the records in each duplicate group containing the most recent &quot;lastCheckin&quot; value or even include &quot;organizationId&quot; as a part of the aggregation. Here's what I came up with:</p>
<pre class="lang-json prettyprint-override"><code>db.collection.aggregate([
  { $match: {
    &quot;_id&quot;: { &quot;$ne&quot;: null },
    &quot;count&quot;: { &quot;$gt&quot;: 1 }
  }},
  { $group: {
    _id: &quot;$data.uuid&quot;,
    &quot;count&quot;: {
      &quot;$sum&quot;: 1
    }
  }},
  { $project: {
    &quot;uuid&quot;: &quot;$_id&quot;, 
    &quot;_id&quot;: 0
  }}
])
</code></pre>
<p>The above was mangled together based on various other stackoverflow posts describing the aggregation of duplicates. I am not sure whether this is the right way to approach this problem. One immediate problem that I can identify is that simply getting the &quot;data.uuid&quot; property without any additional criteria allowing me to identify the invalid duplicates makes it hard to envision a single query that can delete the invalid records without taking the valid records.
Thanks for any help.</p>

