How to do custom repository using TypeORM (MongoDB) in NestJS?<p>I have a question. With <code>@EntityRepository</code> decorator being marked as deprecated in <code>typeorm@^0.3.6</code>, what is now the recommended or TypeScript-friendly way to create a custom repository for an entity in NestJS? A custom repository before would look like this:</p>
<pre><code>// users.repository.ts
import { EntityRepository, Repository } from 'typeorm';
import { User } from './user.entity';

@EntityRepository(User)
export class UsersRepository extends Repository&lt;User&gt; {
  async createUser(firstName: string, lastName: string): Promise&lt;User&gt; {
    const user = this.create({
      firstName,
      lastName,
    });

    await this.save(user);

    return user;
  }
}
</code></pre>
<p>And since NestJS is by default configured with TypeScript support, I will be able to call <code>usersRepository.createUser()</code> without an issue in a service like this:</p>
<pre><code>// users.service.ts
import { Injectable } from '@nestjs/common';
import { InjectRepository } from '@nestjs/typeorm';
import { User } from './user.entity';
import { UsersRepository } from './users.repository';

@Injectable()
export class UsersService {
  constructor(
    @InjectRepository(UsersRepository)
    private readonly usersRepository: UsersRepository,
  ) {}

  async createUser(firstName: string, lastName: string): Promise&lt;User&gt; {
    return this.usersRepository.createUser(firstName, lastName);
  }
}
</code></pre>
<p>This is how the modules would import the custom repository:</p>
<pre><code>// users.module.ts
import { Module } from '@nestjs/common';
import { TypeOrmModule } from '@nestjs/typeorm';
import { UsersController } from './users.controller';
import { UsersRepository } from './users.repository';
import { UsersService } from './users.service';

@Module({
  imports: [TypeOrmModule.forFeature([UsersRepository])],
  controllers: [UsersController],
  providers: [UsersService],
  exports: [UsersService],
})
export class UsersModule {}
</code></pre>
<p>Also the reason why I mentioned MongoDB here is because I tried using <code>typeorm@0.2</code> where <code>@EntityRepository</code> is still supported but I receive an error when I tried to import it in the module stating <code>Repository not found</code> or something. Do note, if I chose <code>postgresql</code> as my database in TypeORM with the same changes above, I don't have this issue. Hence I went to check the latest only to find out it is already deprecated, I also didn't find any example in NestJS documentation.</p>

