MySQL to MongoDB Data migration<p>We know that MongoDB has two ways of modeling relationships between
relations/entities, namely, <strong>embedding</strong> and <strong>referencing</strong> (<a href="https://betterprogramming.pub/embedded-vs-referenced-documents-in-mongodb-how-to-choose-correctly-for-increased-performance-d267769b8671" rel="nofollow noreferrer">see difference here</a>). Let's say we have a <code>USER</code> database with two tables in mySQL named <code>user</code> and <code>address</code>. An embedded MongoDB document might look like this:</p>
<pre><code>{
  &quot;_id&quot;: 1,
  &quot;name&quot;: &quot;Ashley Peacock&quot;,
  &quot;addresses&quot;: [
    {
      &quot;address_line_1&quot;: &quot;10 Downing Street&quot;,
      &quot;address_line_2&quot;: &quot;Westminster&quot;,
      &quot;city&quot;: &quot;London&quot;,
      &quot;postal_code&quot;: &quot;SW1A 2AA&quot;
    },
    {
      &quot;address_line_1&quot;: &quot;221B Baker Street&quot;,
      &quot;address_line_2&quot;: &quot;Marylebone&quot;,
      &quot;city&quot;: &quot;London&quot;,
      &quot;postal_code&quot;: &quot;NW1 6XE&quot;
    }
  ]
}
</code></pre>
<p>Whereas in a referenced relation, 2 SQL tables will make 2 collections in MongoDB which can be migrated by this <a href="https://dzone.com/articles/migrate-mysql-table-data-to-mongodb-collections-us" rel="nofollow noreferrer">apporoach</a> using <code>pymongo</code>.</p>
<p>How can we directly migrate MySQL data as an embedded document using python?</p>
<p>Insights about about Pseudo code and performance of algorithm will be highly useful. Something that comes to my mind is creating <code>views</code> by performing <code>joins</code> in MySQL. But in that case we will not be having the structure of children document inside a parent document.</p>

